#include <iostream>
#include <string>

using namespace std;

class Solution {
public:
    int strStr(string haystack, string needle) {
        
        int firstIndex = 0;
        
        int i,j;
        
        if(needle == "")
            return 0;
        
        if(needle.size() > haystack.size())
            return -1;
        
        char c = needle[0];
        
        for( i = firstIndex; i < haystack.size(); i++) {
            
            //find first c in haystack after firstIndex
            if(c == haystack[i]) {
                
                firstIndex = i;
                
//                for( j = 1; j < needle.size(); j++) {
//                    if(haystack[firstIndex+j] != needle[j]) {
//                        break;
//                    }
//                }
//    
//                
//                if(j >= needle.size())
//                    return firstIndex;
                if (haystack.substr(firstIndex, needle.size()) == needle) {
                    return firstIndex;
                }
            }
        }
        
        
        return -1;
    }
};

int main(int argc, const char * argv[]) {
    // insert code here...
    Solution s;
    
    string a = "";
    string b = "";
    
    std::cout << "Hello, World!\n" << s.strStr(a, b) << "\n";
    return 0;
}
